import React from 'react';
import bg from '../img/bg.jpg';
import styles from '../style/casting.module.scss';



function Casting() {
    return (
        <div className="d-inline">
            <div className="d-block p-2 m-2 bg-danger">
                <div className={styles.casting__img}>
                    <img className="w-10 m-0" src={bg} alt="bg" />
                </div>
                <p>Maria lopez</p>
            </div>
        </div>
    )
}

export default Casting
